import React from "react";
import PingComponent from "./components/PingComponent";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Deploy React + Go to Heroku using Docker</p>
        <PingComponent />
      </header>
    </div>
  );
}

export default App;
